import React from "react";
import notes from "../notes";

function Note() {
  notes.map((note) => {
    <h1>{note.title}</h1>
    console.log(note.title);
    console.log(note.content);
  });
  console.log(notes);
  return (
    <div className="note">
      <h1>this is the title</h1>
      <p>this is the note content</p>
    </div>
  );
}

export default Note;
